const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
        return (
            <div className="custom-tooltip">
                <p className="label">{`${label} : ${payload[0].value}`}</p>
                <div className="active-dot" style={{ backgroundColor: "red", position: "absolute", left: payload[0].cx, top: payload[0].cy, width: 10, height: 10, borderRadius: 5 }} />
                <div className="active-rect" style={{ backgroundColor: "red", position: "absolute", left: payload[0].cx, top: payload[0].cy, width: 100, height: 50 }} />
            </div>
        );
    }

    return null;
};

const renderLegend = () => {
    return <h2 id='lineChart-title'>Durée moyenne des <br />sessions</h2>
}

const CustomTick = ({ index, x, y }) => {
    switch (index) {
        case 0:
            return (
                <text x={x + 10} y={y + 20} fill='#f0bab4'>
                    L
                </text>
            );
        case 1:
            return (
                <text x={x + 5} y={y + 20} fill='#f0bab4'>
                    M
                </text>
            );
        case 2:
            return (
                <text x={x} y={y + 20} fill='#f0bab4'>
                    M
                </text>
            );
        case 3:
            return (
                <text x={x - 5} y={y + 20} fill='#f0bab4'>
                    J
                </text>
            );
        case 4:
            return (
                <text x={x - 10} y={y + 20} fill='#f0bab4'>
                    V
                </text>
            );
        case 5:
            return (
                <text x={x - 15} y={y + 20} fill='#f0bab4'>
                    S
                </text>
            );
        case 6:
            return (
                <text x={x - 20} y={y + 20} fill='#f0bab4'>
                    D
                </text>
            );
        default:
            break;
    }
};

